const UserHome = () => {
  return (
    <div className="user-home">
      <h1>Welcome to Your Homepage!</h1>
      <p>Here you can view your details and manage your account.</p>
      {/* Add other content relevant to the user's homepage */}
    </div>
  );
};

export default UserHome;
